import './App.css';
import React from 'react';
import Formlogin from './Login/form_login';
import Formregister from './Login/form_register';
import Nav from './Vendedor/nav';
import { BrowserRouter,Route,Routes } from 'react-router-dom'; 
function App() {
  return (
    <BrowserRouter>

    <Routes>
      <Route path="/register" element={<Formregister />} /> {/* Ruta para el formulario de registro */}
      <Route path="/login" element={<Formlogin />} /> {/* Ruta para el formulario de registro */}
      <Route path="/nav" element={<Formlogin />} /> {/* Ruta para el formulario de registro */}
        {/* Otras rutas de tu aplicaci√≥n */}
      </Routes>
    </BrowserRouter>
      

  );
}

export default App;
